    <?xml version="1.0"?>
    <description xmlns="http://cpee.org/ns/description/1.0">
      <manipulate id="a3" label="Initialize Count">data.count = 0</manipulate>
      <loop mode="post_test" condition="!data.touch &amp;&amp; data.count &lt;= 10">
        <_probability>
          <_probability_min/>
          <_probability_max/>
          <_probability_avg/>
        </_probability>
        <call id="a1" endpoint="move_down">
          <parameters>
            <label>Move down</label>
            <method>:put</method>
            <arguments/>
          </parameters>
          <code>
            <prepare/>
            <finalize output="result">data.count += 1</finalize>
            <update output="result"/>
            <rescue output="result"/>
          </code>
          <annotations>
            <_generic/>
            <_timing>
              <_timing_weight/>
              <_timing_avg/>
